CONTRATAÇÃO DE EMPRESA, OBJETIVANDO A PARTICIPAÇÃO DE SERVIDORES NO CURSO SOBRE ORÇAMENTO PÚBLICO INTEGRADO COM A EXECUÇÃO ORÇAMENTÁRIA E FINANCEIRA REALIZADO PELA ESAFI, SENDO 4 (QUATRO) SERVIDORES DE FORMA PRESENCIAL, NOS DIAS 26 A 28 DE MARÇO DE 2025 NA CIDADE DE RECIFE/PE, CONFORME DOCUMENTO DE OFICIALIZAÇÃO DE DEMANDA Nº 7/2025/SESAU-SDAO (0057861466).

DETALHES DO EVENTO:

Data: 26 a 28 de março de 2025;

Local: Hotel Transamerica Prestige Beach Class Boa Viagem;

Conteúdo programático: Sistemas de Planejamento e de Orçamento; Expansão do Ciclo Orçamentário; Execução Orçamentária e Financeira; Plano Plurianual (PPA); Receita e Despesa Públicas; Lei De Diretrizes Orçamentárias (LDO); Consolidação das Propostas Setoriais e Tópicos Especiais de Aspectos Fiscais no Orçamento Público;

Saída prevista: 25/03/2025;

Retorno previsto: 28/03/2025.

A escolha de uma empresa qualificada para a realização do treinamento é essencial para garantir que os servidores públicos adquiram conhecimentos técnicos atualizados e em conformidade com as exigências legais do setor público. 
Este curso contribui significativamente para a melhoria da gestão pública, promovendo maior eficiência, transparência e governança, fatores essenciais para o uso adequado dos recursos públicos e o alcance das metas governamentais.
A contratação de cursos de capacitação em Orçamento Público tem como objetivo proporcionar aos servidores a formação necessária para o correto cumprimento das normas que regem o planejamento e a execução orçamentária nos níveis municipal, estadual e federal. 
Dentre os principais desafios enfrentados pela gestão pública, destaca-se a complexidade das legislações que regulam o orçamento público, como o Plano Plurianual (PPA), a Lei de Diretrizes Orçamentárias (LDO) e a Lei Orçamentária Anual (LOA). Além disso, a implementação de políticas públicas e o monitoramento dos índices orçamentários exigem conhecimento especializado para assegurar a conformidade com a legislação e garantir uma gestão pública eficiente.

Contratação de empresa para prestação de serviço de locação de espaço e de apoio à realização de evento, com os serviços de acompanhamento de evento, como equipe de apoio, transporte e alimentação dos participantes.
Evento a ser realizado nos dias 25 e 26 de março e 09 de Abril de 2025, na cidade de São José dos Campos/SP;
Aluguel de espaço para realização do evento, com respectiva infraestrutura e serviços operacionais;
